import React from "react";

import { about } from "./stockPhotos/portBW1.JPG";
import "./Dashboard.scss";

function Dashboard() {
  return (
    <div className='dashboard-container'>
      <img className='about-img' src={about} alt='' />
    </div>
  );
}
export default Dashboard;
